import React from 'react'
import { Card } from 'react-bootstrap';


const checklist = ({part1,part2,part3}) => {


    return (
        <>
        <Card>
            <Card><h4>Part 1: {part1}</h4></Card>
            <Card>Part 2: {part2}</Card>
            <Card>Part 3: {part3}</Card>
        </Card>
        </>
    )
}

export default checklist
